import { DefaultHeader } from "../Header";
import { NewValue } from "../NewValueForm";
import { ValueList } from "../ValueList";

export function StartedHome({ setValue }) {
  return (
    <>
      <DefaultHeader />
      <div className="flex">
        <NewValue
          onSubmit={(e) => {
            e.preventDefault();
            setValue();
          }}
        />
        <ValueList />
      </div>
    </>
  );
}
